import './Header.css'

function Header() {
    return (
      <header>
        <div class="menu">
            <a href="/login" class="login">로그인</a>
            <a href="/register" class="register">회원가입</a>
        </div>
        
        <hr/>
        <a href="/" class="logo">
            <div>Community</div>
        </a>
        <hr/>
      </header>
    );
  }
  
  export default Header;
